import React, { useState } from "react";
import { Button, Modal, Carousel } from "antd";

const ProjectModal = ({ open, onClose, meta }) => {
  const imageRender = () => {
    if (meta) {
      let i = 0;
      for (i = 1; i < 9; i++) {
        console.log(i);
        return i
      }
    }
  };
  return (
    <Modal title="Modal 1000px width" centered open={open} onCancel={onClose}>
      <Carousel autoplay>
        {imageRender.map((i) => {
          return (
            <div>
              <img src={`/images/meta/meta-${i}.png`} alt="meta" />
            </div>
          );
        })}
      </Carousel>
    </Modal>
  );
};

export default ProjectModal;
